Define Components Components are simple data structures. struct Position { int x; int y;
}; Create Systems Systems are functions that process components. void logging_system(Registry& r, containers::indexed_zipper<SparseArray<Position>, SparseArray<Velocity>> zipper)
{ for (auto&& [i, pos, vel] : zipper) std::cerr << i << ": Position = { " << pos.value().x << ", " << pos.value().y << " }" << std ::endl; std::cerr << i << ": Velocity = { " << vel->x << ", " << vel->y << " }" << std ::endl;
} Setup Registry The registry holds the ECS. Registry r;
r.register_component<Position>();
r.register_component<Velocity>(); Create Entities Entity player = r.spawn_entity(); Add Components to Entities r.emplace_component<Position>(player, 2, 23);
r.emplace_component<Velocity>(player, 1, 0); Register and Run Systems r.add_{render/update}_system<Position, Velocity>(logging_system);
r.{render/update}(); Cleanup r.kill_entity(player);

